(30, 23, 'hi', 'कहाँ से आता है?', '<p>आम धारणा के विपरीत, लोरेम इप्सम केवल यादृच्छिक पाठ नहीं है। इसकी जड़ें 45 ईसा पूर्व के शास्त्रीय लैटिन साहित्य के एक टुकड़े में हैं, जो इसे 2000 साल से अधिक पुराना बनाता है। वर्जीनिया के हैम्पडेन-सिडनी कॉलेज में एक लैटिन प्रोफेसर रिचर्ड मैक्लिंटॉक ने इनमें से एक को देखा</p>', '2023-04-20 23:50:16', '2023-04-20 23:50:16'),
(31, 24, 'en', 'What is Lorem Ipsum', '<p><strong style=\"color: rgb(0, 0, 0);\">Lorem Ipsum</strong><span style=\"color: rgb(0, 0, 0);\">&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</span></p>', '2023-04-26 02:30:40', '2023-04-26 02:30:40'),
(32, 24, 'hi', 'लोरेम इप्सम क्या है?', '<p>लोरेम इप्सम प्रिंटिंग और टाइपसेटिंग उद्योग का केवल डमी टेक्स्ट है। लोरेम इप्सम 1500 के दशक के बाद से उद्योग का मानक डमी टेक्स्ट रहा है, जब एक अज्ञात प्रिंटर ने टाइप की एक गैली ली और एक टाइप नमूना पुस्तक बनाने के लिए इसे स्क्रैम्बल किया। यह न केवल पांच शताब्दियों तक जीवित रहा है, बल्कि अनिवार्य रूप से अपरिवर्तित शेष रहते हुए, इलेक्ट्रॉनिक टाइपसेटिंग में छलांग भी लगाई है। इसे 1960 के दशक में लोरेम इप्सम पैसेज वाली लेट्रासेट शीट्स के रिलीज के साथ लोकप्रिय किया गया था, और हाल ही में लोरेम इप्सम के संस्करणों सहित एल्डस पेजमेकर जैसे डेस्कटॉप पब्लिशिंग सॉफ्टवेयर के साथ इसे लोकप्रिय बनाया गया था।</p>', '2023-04-26 02:31:56', '2023-04-26 02:31:56'),
(33, 25, 'hi', 'this new faq', '<p>this is faq desc</p>', '2023-04-27 04:25:46', '2023-04-27 04:25:46'),
(34, 26, 'hi', 'मुझे कुछ भाग कहा मिल सकता है?', '<p><span style=\"color: rgb(0, 0, 0);\">यह एक लंबा स्थापित तथ्य है कि जब एक पाठक एक पृष्ठ के खाखे को देखेगा तो पठनीय सामग्री से विचलित हो जाएगा. Lorem Ipsum का उपयोग करने का मुद्दा यह है कि इसमें एक और अधिक या कम अक्षरों का सामान्य वितरण किया गया है</span></p>', '2023-04-27 04:40:15', '2023-04-27 04:40:15'),
(35, 27, 'en', 'Why do we use it?', '<p><span style=\"color: rgb(0, 0, 0);\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing</span></p>', '2023-04-27 04:46:52', '2023-04-27 04:46:52');
